<!--注册 -->
<template>
    <div class='register-container'>
        <h1>注册</h1>
         <div class='login-box'>
          <div class='form-box'>
            <mt-field  placeholder="请输入用户名" v-model="account"></mt-field>
            <mt-field  placeholder="请输入密码" type="password" v-model="password"></mt-field>
          </div>
          <div class='btn-box'>
            <mt-button type="primary" @click="register" class='login-button'>注册</mt-button><br/>
            <router-link to='/Login'>
                <span class='Register'>去登录</span>
            </router-link>
          </div>
         </div>
    </div>
</template>
<script>
import * as loginApi from '../../webApi/login'
import { Toast } from 'mint-ui';
import userPic6 from '../../assets/img/6.jpg'
export default {
  name:'Register',
  data () {
    return {
      account:'',
      password:'',
      headPic:'data:image/jpeg;base64,'
    }
  },
  methods: {
    register(){
      if(this.checkForm()){
        const option = {account:this.account,password:this.password,headPic:this.headPic};
        loginApi.createAccount(option)
        .then(res =>{
          console.log(res)
          console.log('注册成功')
        })
        .catch(err =>{

        })
      }

    },
    checkForm (){
      if(!this.account){
        Toast({
          message: '账号不能为空',
        });
        return false;
      }
      if(!this.password){
        Toast({
          message: '密码不能为空',
        });
        return false;
      }
      return true;
    }

  }
  

}
</script>
